import React from 'react';
import { StyledNav, List, ListItem, Link } from './styles';

export interface INavProps {
  light?: boolean;
  asymmetric?: boolean;
  width?: number;
  align?: 'left' | 'center' | 'right';
  className?: string;
}

const Nav: React.FC<INavProps> = ({ light, align, asymmetric, width, className }) => {
  return (
    <StyledNav light={light} className={className}>
      <List>
        <ListItem>
          <Link href='#'>Доставка</Link>
        </ListItem>
        <ListItem>
          <Link href='#'>Гарантия</Link>
        </ListItem>
        <ListItem>
          <Link href='#'>Контакты</Link>
        </ListItem>
      </List>
    </StyledNav>
  )
};

export default Nav;
